import React from "react";
import { StyleSheet, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Button } from "react-native-elements";
import { Font } from "expo";
import { Item } from "react-navigation-header-buttons";

import CalendarComponent from "./Screens/Calendar";
import MapComponent from "./Screens/Map";
import HomeComponent from "./Screens/Home";
import Event, { Transition } from "./Screens/Events";
import About from "./Screens/AboutUs";
import Contact from "./Screens/ContactUs";
import ScheduleTourComponent from "./Screens/ScheduleTours";
import LoginComponent from "./Screens/Login";
import DashboardComponent from "./Screens/Dashboard";

const Stack = createStackNavigator();

const createScreen = (name, comp) => {
  return (
    <Stack.Screen
      name={name}
      options={{
        title: " ",
        headerTintColor: "#ea6227",
        headerTransparent: true,
      }}
      component={comp}
    />
  );
};
const App = () => {
  /* const IoniconsHeaderButton = (props) => (
    // the `props` here come from <Item ... />
    // you may access them and pass something else to `HeaderButton` if you like
    <HeaderButton IconComponent={Ionicons} iconSize={23} {...props} />
  ); */

  return (
    // Navigate between multiple screens
    <NavigationContainer>
      <Stack.Navigator>
        {createScreen("Home", HomeComponent)}
        {createScreen("Calendar", CalendarComponent)}
        {createScreen("Map", MapComponent)}
        {createScreen("Event", Event)}
        {createScreen("About Us", About)}
        {createScreen("Contact Us", Contact)}
        {createScreen("Schedule Tours", ScheduleTourComponent)}
        {createScreen("Login", LoginComponent)}
        {createScreen("Dashboard", DashboardComponent)}
        {createScreen("Transition", Transition)}
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
